import React, { Component } from 'react';
import mainLogo from './iron-box.png';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import AppBar from '@material-ui/core/AppBar';
import { Link,Redirect } from 'react-router-dom';
import Login1 from './Login1';


class NewUserLogin extends Component {
    state = {
        details:{
            name:'',
            phonenumber:'',
            password:'',
            confirmpassword:''
        }
     }

    onChange=e=>{
        const details ={...this.state.details}
        details[e.currentTarget.name] = e.currentTarget.value;
        this.setState({ details });
    } 

    onSubmti=e=>{
        e.preventDefault();
    }


    render() { 
        return ( 
            <div>
        <h2 style={{color:'red',marginLeft:'40%'}}>New User Sign In page</h2>

        <div className='form'>

        <form>
            <TextField 
                type='text'
                id='name'
                placeholder='Enter your Name'
                name='name'
                value={this.state.details.name}
                onChange={this.onChange}
            />

            <TextField 
                type='password'
                id='password'
                placeholder='Enter your Password'
                name='password'
                value={this.state.details.password}
                onChange={this.onChange}
            />
            <br/>
            <TextField 
                type='text'
                id='phonenumber'
                placeholder='Enter Your Phone Number'
                name='phonenumber'
                value={this.state.details.phonenumber}
                onChange={this.onChange}
                style={{margin:25,left:5}}
            />
        </form>




        </div>
        </div>
         );
    }
}


export default NewUserLogin;
